import PacientHome from "./pacientHome/pacientHome";
import {Route, Routes} from "react-router-dom";
import LayoutAfterLogIn from "./pacientHome/Layout_After_LogIn_Pacient/Layout_After_LogIn";
import LayoutBeforeLogIn from "../beforeLogIn/Layout_Before_LogIn/Layout_Before_LogIn";
import AllMedics from "../beforeLogIn/Medics/AllMedics";
import AllServices from "../beforeLogIn/Services/AllServices";
import OpeningHours from "../beforeLogIn/OpeningHours/OpeningHours";
import Contact from "../beforeLogIn/Contact/Contact";

function SiteAfterLogIn(){
    return(
    <div>
        <Routes>
            <Route
                path="/"
                element={
                    <LayoutAfterLogIn>

                    </LayoutAfterLogIn>
                }
            />
            <Route
                path="medics/*"
                element={
                    <LayoutBeforeLogIn>
                        <AllMedics />
                    </LayoutBeforeLogIn>
                }
            />
            <Route
                path="services/*"
                element={
                    <LayoutBeforeLogIn>
                        <AllServices />
                    </LayoutBeforeLogIn>
                }
            />
            <Route
                path="opening-hours"
                element={
                    <LayoutBeforeLogIn>
                        <OpeningHours />
                    </LayoutBeforeLogIn>
                }
            />
            <Route
                path="Contact"
                element={
                    <LayoutBeforeLogIn>
                        <Contact />
                    </LayoutBeforeLogIn>
                }
            />
        </Routes>
    </div>
    );
}

export default SiteAfterLogIn;
